import React from 'react'

const Footer = () => {
  return (
    <footer style={{backgroundColor:'grey'}}>
        <p>Powered by</p>
        <img src="./images/DH.png" alt='DH-logo' />
        <img src="./images/ico-facebook.png" alt="" style={{width:'50px', marginLeft:'20px'}}/>
    </footer>
  )
}

export default Footer
